package day3;

public class Continue {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        for(int k=5;k<15;k++) {
        	//odd no r skipped
        	
        	if(k%2 !=0)
        		continue;
        	    //even number are printed
        	System.out.println(k+" ");
        	
        }
	}

}
